INSERT INTO `noticia` VALUES (18,'ReuniÃ³n dÃ­a lunes','ReuniÃ³n dÃ­a lunes a las 18:00hrs','2024-10-28 14:52:53',21,3351),(20,'ReuniÃ³n de Junta de Vecinos','Se convoca cordialmente a todos los vecinos a participar en una reuniÃ³n de la junta de vecinos, donde se abordarÃ¡n temas de gran importancia para nuestra comunidad. Entre los puntos a tratar se encuentran las mejoras en la seguridad del vecindario, el mantenimiento de Ã¡reas comunes y la planificaciÃ³n de nuevos proyectos que beneficiarÃ¡n a todos los residentes. Esta es una oportunidad para compartir opiniones, sugerencias y trabajar en conjunto por un entorno mÃ¡s seguro y agradable para todos. La reuniÃ³n se llevarÃ¡ a cabo el dÃ­a 20 de noviembre a las 18:00 en el salÃ³n comunal. Se agradece la asistencia de todos los vecinos interesados en contribuir al bienestar de nuestra comunidad.','2024-11-20 18:00:00',22,3351),(31,'Nuevo Proyecto de RenovaciÃ³n Urbana','Hoy, la municipalidad ha anunciado el lanzamiento de un nuevo proyecto de renovaciÃ³n urbana en el centro de la ciudad. El proyecto busca mejorar las infraestructuras viales, crear nuevos espacios verdes y ofrecer mejores servicios a la comunidad. La iniciativa comenzarÃ¡ en el mes de enero de 2025 y se espera que dure aproximadamente dos aÃ±os.','2024-11-19 02:19:31',42,3351);
