INSERT INTO `proyecto` VALUES (8,'PROYECTO DE PRUEBA DE VECINO','DuraciÃ³n del Proyecto: 6 meses\n\nPresupuesto Estimado: $5,000,000 CLP\n\n1. IntroducciÃ³n\n\nEl proyecto de la Junta de Vecinos \"Barrio Verde\" se propone mejorar la cohesiÃ³n social y el bienestar de la comunidad, fortaleciendo las redes de apoyo vecinal y optimizando los espacios comunes del sector. Este proyecto responde a la necesidad de contar con Ã¡reas recreativas seguras y bien mantenidas, ademÃ¡s de actividades que impulsen la participaciÃ³n ciudadana en el cuidado del entorno y el fortalecimiento de los vÃ­nculos vecinales.\n\n2. Objetivos del Proyecto\n\nObjetivo General: Fortalecer la participaciÃ³n ciudadana en el barrio mediante actividades comunitarias y mejoras en espacios comunes.\n\nObjetivos EspecÃ­ficos:\n\nRealizar talleres y capacitaciones que fomenten el sentido de pertenencia y la participaciÃ³n activa de los vecinos.\nRehabilitar Ã¡reas comunes como plazas, parques y zonas de esparcimiento.\nImplementar un sistema de comunicaciÃ³n interna y notificaciones para informar a los vecinos sobre actividades y noticias de la comunidad.\n3. JustificaciÃ³n\n\nEste proyecto nace de la preocupaciÃ³n por el deterioro de espacios comunes y la falta de interacciÃ³n comunitaria. Al fomentar un entorno de respeto y colaboraciÃ³n, se espera mejorar tanto la calidad de vida de los residentes como la seguridad y cuidado de los espacios pÃºblicos. AdemÃ¡s, mediante la publicaciÃ³n de noticias y actividades, se busca mantener informados a los vecinos y motivarlos a participar activamente en las decisiones del barrio.\n\n4. Actividades\n\nCapacitaciones y Talleres: Cursos de jardinerÃ­a, reciclaje, primeros auxilios y seguridad vecinal, a fin de empoderar a los residentes en temas relevantes para la comunidad.\n\nRehabilitaciÃ³n de Espacios: Pintura y limpieza de plazas y parques, instalaciÃ³n de mobiliario urbano, y creaciÃ³n de murales comunitarios.\n\nSistema de ComunicaciÃ³n Comunitaria: Desarrollo de una plataforma digital para la publicaciÃ³n de noticias, notificaciones y eventos relevantes para el barrio, permitiendo una comunicaciÃ³n mÃ¡s eficiente y oportuna.\n\n5. Recursos Necesarios\n\nHumanos: Voluntarios, tÃ©cnicos en rehabilitaciÃ³n de espacios, facilitadores de talleres, y un desarrollador para la plataforma digital.\n\nMateriales: Pintura, herramientas de jardinerÃ­a, mobiliario urbano (bancas, papeleras, juegos infantiles), materiales de construcciÃ³n para mejoras menores en los parques.\n\nEconÃ³micos: Fondos municipales o patrocinio de empresas locales para cubrir los costos de materiales y personal tÃ©cnico.\n\n6. Cronograma\n\nMes 1-2: PlanificaciÃ³n y preparaciÃ³n de los recursos necesarios, selecciÃ³n de espacios y talleristas.\nMes 3-4: ImplementaciÃ³n de talleres y capacitaciones, inicio de las mejoras en los espacios comunes.\nMes 5: FinalizaciÃ³n de mejoras en los espacios, implementaciÃ³n del sistema de comunicaciÃ³n.\nMes 6: EvaluaciÃ³n de los resultados y cierre del proyecto.\n7. Resultados Esperados\n\nIncremento en la participaciÃ³n de vecinos en actividades comunitarias.\nMejora en el estado de los espacios comunes, convirtiÃ©ndolos en Ã¡reas seguras y atractivas.\nComunicaciÃ³n efectiva y continua entre la Junta de Vecinos y la comunidad.\n8. Indicadores de Ã‰xito\n\nCantidad de vecinos participantes en las actividades y capacitaciones.\nNiveles de satisfacciÃ³n con las mejoras en los espacios comunes.\nFrecuencia y alcance de las notificaciones y noticias compartidas en la plataforma comunitaria.\nConclusiÃ³n\n\nEl Programa de Fortalecimiento Comunitario y Mejoramiento del Espacio ComÃºn busca consolidar un barrio unido y seguro, donde los vecinos se sientan valorados y motivados a cuidar su entorno. Con la colaboraciÃ³n de todos, este proyecto serÃ¡ una base sÃ³lida para futuras iniciativas de desarrollo y bienestar comunal.',3334,31,1,'2024-11-02 17:00:08','PROYECTO RECHAZADO TEST 5','2024-11-02 17:33:15','','',0,''),(10,'RemodelaciÃ³n sede','Hay que remodelar el techo por las lluvias...',3351,38,1,'2024-11-04 17:55:40',NULL,NULL,'Sede','$1.500.000',2,'Remodelar el techo'),(11,'RemodelaciÃ³n sede 2','Hay que remodelar de nuevo',3351,39,1,'2024-11-04 17:57:41','No vale la pena','2024-11-04 18:00:57','Sede','$1.500.000',2,'Remodelar el techo de nuevo');
